    function renderWord() {
        //let arr = [];
        GetAllWord().then(value => {

            let arr = value.map(item => {
                return (
                    <Word
                        key={item.id}
                        word={item.word}
                        translation={item.translation}
                    />)
            });
            return arr;
        });
        //console.log(arr);
        //return arr
    }


    return (
        <div>
            <button onClick={renderWord}>x</button>
            {/*{renderWord()}*/}
        </div>
    );
}

